bool Gra::czy_zlapany(postac*goniacy[],int ilosc, postac * gracz)
{
	for (int i = 0; i < ilosc; i++)
	{
		if (pozycja_srodek(goniacy[i]->poz) == pozycja_srodek(gracz->poz))
		{
			return 1;
		}
	}

	if (pozycja_srodek(gracz->poz) == 15 && ilosc_k == indeks_k) { return 1; }

	return 0;
}

