klucz * Gra::generuj_klucz(klucz * wynik)
{

	

	SYSTEMTIME s1;
	GetSystemTime(&s1);
	int x=s1.wMilliseconds%15, y=s1.wMilliseconds%9;
	while (kolizja[y+1][x+1] == 1) { GetSystemTime(&s1); x = s1.wMilliseconds % 15 ; y = s1.wMilliseconds % 9 ; }

	wynik->wymiar = generuj_rect(wynik->wymiar, 120, 120, x * 120, y * 120);
	wynik->wyglad = Tekstura::Load("grafika/klucz3.png",renderer);
	
	return wynik;

}
