void Gra::Zdarzenia()
{
	SDL_Event zdarzenie;
	SDL_PollEvent(&zdarzenie);
	switch (zdarzenie.type)
	{
	case SDL_QUIT:
		running_e = false;
		running_t = false;
		menu_r = false;
	default:
		break;
	}

}

void Gra::Update_s()
{
	
	if (zegar == cykl)
	{
		for (int i = 0; i < liczba_sredniakow; i++)
		{
			funkcja_ruch_sredniacy[i] = ruch_e(gracz1->poz, sredniacy[i]->poz, macierz_R, macierzRW, pozycjax,pierwszenstwo);
		}
		zegar = 0;
		inicjuj_pierwszenstwo();
		indeks_mapy++;
	}

	for (int i = 0; i < liczba_sredniakow; i++)
	{
		funkcja_ruch_sredniacy[i](sredniacy[i]->poz, zegar, mSpeed);
	}

	if (czy_zlapany(sredniacy, liczba_sredniakow, gracz1)) { running_s = 0; menu_r = 1; }

	ruch(gracz1->poz, kolizja, mSpeed / 1.5, zegar);
	czy_zatrzymac(running_s);
	czy_zniszcz_klucz(indeks_k, ilosc_k, gracz1, klucze, zegar);

	gracz1->poz->h = 120;
	gracz1->poz->w = 120;
	zegar++;
	

}



void Gra::Upadate_e()
{
	//Takie warunek logiczny jest w kadej metodzie update
	//Ma ona na celu zmian ruchu przez goce w odpowiedniej chwili
	//Dziki temu redukujemy take liczb oblicze
	if (zegar == cykl)
	{
		for (int i = 0; i < liczba_poszukiwaczy; i++
			)
		{
			funkcja_ruch_gonce[i] = ruch_ep(gracz1->poz, poszukiwacze[i]->poz, macierzRW,pozycjax,pierwszenstwo);
		}
			zegar = 0;
			inicjuj_pierwszenstwo();
			indeks_mapy++;
			
	}
	
	for (int i = 0; i<liczba_poszukiwaczy; i++)
	{
		//funkcja ta bezporednio posiada wskanik na pozycj goca aby mc j modyfikwa
		funkcja_ruch_gonce[i](poszukiwacze[i]->poz,zegar,mSpeed);

	}
	
	if (czy_zlapany(poszukiwacze, liczba_poszukiwaczy, gracz1)) { menu_r = 1; running_e = 0; }
	ruch(gracz1->poz,kolizja,mSpeed/1.5,zegar);
	czy_zatrzymac(running_e);
	czy_zniszcz_klucz(indeks_k, ilosc_k, gracz1, klucze, zegar);

	gracz1->poz->h = 120;
	gracz1->poz->w = 120;
	zegar++;
}

