void Gra::readSpeed()
{
	std::fstream file;
	file.open("speed.txt", ios::in);
	std::string tmp;

	std::map<int, int > matches = { {1, 16}, {2, 8}, {3, 4} };
	std::getline(file, tmp, ' ');
	file >> mSpeed;
	mSpeed = matches[mSpeed];

	zegar = mSpeed * 120;
	cykl = zegar;

	file.close();
}